  [],\n\t\"revision_timestamp\": \"2016-07-16T01:35:02.755892\",\n\t\"name\": \"salmonid-spawning\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In order for the state of Idaho to utilize
  temperature criteria to protect various stream uses, such as spawning, the state
  is required to designate when and where spawning may occur. While Idaho previously
  has some waters designated for salmonid spawning in its water quality standards,
  many other waters where salmonids may or do spawn remain undesignated. This data
  takes the Idaho 305(b) streams and determines which portions of them are possible
  salmonid spawning areas.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
